import React from "react";

function RoomDetailItem(props) {
  return (
    <div className="rooms__detail__item">
      <img
        classname="rooms__detail__img"
        alt="rooms detail img"
        src={props.src}
      />
    </div>
  );
}

export default RoomDetailItem;
